import './App.css';
import data from './data';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Card from './components/Card';



function App() {
  const Cards = data.map(card => {
    return <Card 
                  key={card.id}
                  card={card}
                  />
   })

  return (
    <div className="contacts">
     <Navbar/>
     <section className='cards-list'>
     {Cards}

     </section>

    </div>
  );
}

export default App;
